import Noidung from '../edit_tintuc/noidung';
import Tieude from '../edit_tintuc/tieude';
import React, { useState, useEffect } from 'react';
//import axios from 'axios';

function Xuhuong() {
  const [postArray, setPostArray] = useState([]);
  useEffect(() => {
    async function LayDL() {
      try {
        var axios = require('axios');
        var data = JSON.stringify({ "body": "{\"cateId\":31,\"orderType\":0,\"groupType\":13,\"contentType\":0,\"filterType\":0,\"trending\":0,\"page\":1,\"pageSize\":100}" });
        var config = {
          method: 'post',
          url: 'http://10.144.13.35:8080/vnnews-api/getNewsList',
          headers: {
            'Access-Control-Allow-Origin ': '*',
            'requestTime': '0',
            'Content-Type': 'application/json'
          },
          data: data
        };
        axios(config)
          .then(function (response) {
            console.log(JSON.stringify(response.data));
          })
          .catch(function (error) {
            console.log(error);
          });

      } catch (e) {
        console.log(e.message);
      }
    }
    LayDL();
  }, []);
  return (
    <div className="news_xh">
      <div className="news_td">
        <div className="td_title">
          <i className="fas fa-chart-line fa-2x" style={{ color: 'blue' }} />{' '}
          <Tieude title="Xu hướng" />
        </div>{' '}
        <div className="td_tag">
          <div className="tag">
            <a href> Học sinh </a>
          </div>
          <div className="tag">
            <a href> Học sinh </a>
          </div>
          <div className="tag">
